import React from "react";
import Box from '@mui/material/Box';
import Header from "../../components/Header/header";
import Cartlist from "../../components/Cartlist/Cartlist";
import {getCart} from '../../Services/dataservice'
import { OneKPlusOutlined } from "@mui/icons-material";
import { Grid,Paper,Typography } from "@mui/material";




function Cart(){
    const [bookCart,setBookCart]=React.useState([])

    const getBooksFromCart=(data)=>{
        getCart().then((response)=>{

                setBookCart(response.data.result)

            }).catch((error)=>{

                console.log(error)

            })

        }
        React.useEffect(()=>{
            //console.log(getBook)
            getBooksFromCart()

        },[])




    return(
        <Box sx={{
            width:'100vw',
            height:'100vh',
            display:'flex',
            flexDirection:'column'

        }}>
            <Box>
                <Header/>
            </Box>
            <Paper>
            <Grid>
                {
                    bookCart.map((book)=>(
                    <Cartlist book={book}/>))
                }

            </Grid>
            <Card sx={{

                    width:'100%',
                    height:80,
                    marginBottom:2,}}
                >
                    <Typography sx={{display:'flex',justifyContent:'flex-start',
                     postion:'absolute',left:100,top:100}}>
                        Address Details
                    </Typography>
                </Card>
            </Paper>

        </Box>)

}


export default Cart
